import {Form as form} from 'react-materialize'

class Form extends React.Component{
    constructor(props){
        super(props);
        this.title=React.createRef();
        this.description=React.createRef();
    }
    render(){
        return(
            <div>
                <div style={{textAlign:"center"}}>
				<div class='form'>
				<label style={{fontSize: "2em"}}>CREATE TASK</label><br/><br/><br/>
				<img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQdLlL2Ebb5odyDgvmLj33TXvrYUb-Psspq1137g1WNIjgRo_RKgA" alt="" width="200px" height="200px"/><br/><br/>
				<label>TITLE</label><br/><br/>
				<input /><br/><br/>
                <label>DESCRIPTION</label><br/><br/>
				<input ref={this.description}/><br/><br/>
				<button style={{cursor: "pointer",fontSize: "1em"}}onClick={this.register}>Create</button><br/><br/>
				</div>
			</div>

            </div>
        )
    }
}
export default Form;
